import React, {useEffect, useState} from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';

import Container from '@material-ui/core/Container';
import TextInpunts from "../components/textInput";
import Custom_Button from "../components/button";
import FormconrrllCheckbox from "../components/formcontrollcheckbox";
import RadioForcontroll from "../components/radioformcontrol";
import Card from '@material-ui/core/Card';

import AssignmentIcon from '@material-ui/icons/Assignment';
import Typography from '@material-ui/core/Typography';
import {useStyles_testU} from '../design/styles';

const SignIn_Form = () => {
  const classes = useStyles_testU();


  const [user, setUser] = useState({});
	const [allUsersData, setAllUsersData] = useState([]);
	const [singleUser, setSingleUser] = useState(-1);


	useEffect(() => {
        let allUsersData = [];
        try{
			if(window.localStorage.getItem('users'))
				allUsersData = window.localStorage.getItem('users');
			if(allUsersData.length && typeof allUsersData !== 'undefined')
			{
				allUsersData = JSON.parse(allUsersData);
				setAllUsersData(allUsersData);
			}

			if(allUsersData.length && window.localStorage.getItem('edit_user'))
			{
				let userEdit = JSON.parse(window.localStorage.getItem('edit_user'));
				if(userEdit>-1 && userEdit < allUsersData.length)
					setUser(allUsersData[userEdit]);
				setSingleUser(userEdit);
			}

		}
		catch(e){
			console.log("CAUGHT ERROR:Table", e);
		}
    },[]);

	const handleDataUpdate = (ele) => {
		setUser({ ...user, [ele.target.attributes.getNamedItem('ele_name').value]: ele.target.value });
	}

	const onSubmit = (event) => {
		event.preventDefault();
		if(!(user.fname && user.lname))
			return;
		if(singleUser<0)
			allUsersData.push(user);
		else
			allUsersData[singleUser] = user;
		window.localStorage.setItem('users', JSON.stringify(allUsersData));
	};

  return (
    <Container component="main" maxWidth="sm">
       <Card className={classes.root} style={{padding: 18}}>
      <CssBaseline />
      <div className={classes.paper}>
        <Avatar className={classes.avatar} style={{backgroundColor:'#357a38'}}>
          <AssignmentIcon />
        </Avatar>
        <Typography component="h1">
          <span style={{color:'#121858', fontWeight: 'bold'}}> Student Data Form </span>  
        </Typography>

        <form className={classes.form} onSubmit={onSubmit}>
          <TextField
            type="text"
            name="user[fname]"
            value={user.fname?user.fname:""}
            onChange={handleDataUpdate}
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="fname"
            label="First Name"
            autoComplete=""
            autoFocus
          />

          <TextInpunts
           id="fname"
           text={"First Name"}
           name="fname" 
           onChange={(text) => onPress(event)}
           />
          <TextInpunts
           id="lname"
           text={"Last Name"}
           name="lname" 
           />
          <TextInpunts
            id="email"
            text={"Email Address"}
            name="email"
            autoComplete="email"
            autoFocus
          />
          <TextInpunts
            id="mobile"
            text={"Mobile Number"}
            name="mobile"
            autoComplete="mobile"
            autoFocus
          />
          <TextInpunts
            name="password"
            text="Password"
            type="password"
            id="password"
            autoComplete="current-password"
          />
          <FormconrrllCheckbox  val={"hiiiii"} labeltext={"English"}/>
          <RadioForcontroll />
          <Custom_Button type={'submit'} name={"Submit"} onClick={()=>{alert('HI')}} />
        </form>
      </div>
      </Card>
    </Container>
  );
}

export default SignIn_Form;
